import React, { Component } from "react";
import "./App.css";

class Profile extends Component {
  render() {
    console.log(this.props);

    let pantone = {
      PantoneID: "0",
      Code: "0",
      Hex: "#333",
      R: "9",
      G: "9",
      B: "9"
    };

    if (this.props.pantone != null)
      return (
        <div className="profile">
          <div>Item</div>
          <div>Color</div>
        </div>
      );
  }
}

export default Profile;
